<html><body><div text=align:justify><div align=center><H2 style="margin-left: auto; margin-right: auto;"> ХАРАКТЕРИСТИКА </H2> </div><br>	Анастасия Григорьевна Фадеева родится семнадцатого октября 2059. <br><p>Традцатого апреля 2112 устроится на работу в Фонд на должность корректировщика. </p><p>	Окончательно уволится восемнадцатого октября 2131. </p><p>Дата созадния документа 12.02.2023</p></div></body></html>
